import * as d3 from "d3";

function crudeOilProduction(data, {

  barHeight = 25,
  marginTop = 20,
  marginRight = 100,
  marginBottom = 20,
  marginLeft = 40,
  width = 800,
  height = Math.ceil((data.length + 0.1) * barHeight) + marginTop + marginBottom
} = {}) {

  // console.log(data);
  const x = d3.scaleLinear()
    .domain([0, d3.max(data, d => +d.原油生产量)]).nice()
    .range([marginLeft, width - marginRight]);

  const y = d3.scaleBand()
    .domain(d3.sort(data, d => -d.frequency).map(d => d.地区))
    .rangeRound([marginTop, height - marginBottom])
    .padding(0.1);


  // Create the SVG container.
  const svg = d3.select("#svg3")
    .attr("width", width)
    .attr("height", height)
    .attr("viewBox", [0, 0, width, height])
    .attr("style", "max-width: 100%; height: auto; font: 10px sans-serif;");

  // Append a rect for each letter.
  svg.append("g")
    .attr("fill", "steelblue")
    .selectAll()
    .data(data)
    .join("rect")
    .attr("x", x(0))
    .attr("y", (d) => y(d.地区))
    .attr("width", (d) => x(d.原油生产量) - x(0))
    .attr("height", y.bandwidth());


  // Create the axes.
  svg.append("g")
    .attr("transform", `translate(0,${marginTop})`)
    .call(d3.axisTop(x).ticks(width / 80).tickSizeInner(4))
    .call(g => g.select(".domain").remove())
    .call(g => g.append("text")
      .attr("x", width - marginRight - 20)
      .attr("y", 10)
      .attr("fill", "grey")
      .attr("text-anchor", "start")
      .text("原油生产量(万吨)"));

  svg.append("g")
    .attr("transform", `translate(${marginLeft},0)`)
    .call(d3.axisLeft(y).tickSizeOuter(0));

  return svg.node();

}

export default crudeOilProduction;
